import { useEffect, useState } from "react";
import useHttp from "../components/hooks/response-hook";

const EventsPage = () => {
  const { isLoading: isFetching, error, sendRequest: fetchEvents } = useHttp();
  const [fetchedEvents, setFetchedEvents] = useState();

  useEffect(() => {
    const transformData = (objTransform) => {
      const fetchData = [];
      for (const key in objTransform) {
        fetchData.push({ id: key, title: objTransform[key].text });
      }

      console.log(objTransform, fetchData);
      setFetchedEvents(fetchData);
    };

    fetchEvents({ url: "http://localhost:8080/events" }, transformData);
  }, [fetchEvents]);

  return (
    <>
      {isFetching && <p>Loading Events</p>}
      {error && <p>{error.message}</p>}
      {!isFetching && fetchedEvents && <EventsList />}
    </>
  );
};

export default EventsPage;
